import React from 'react';
import Logo from 'C://Users//visha//Downloads//logo.svg';
const Header = () => {
  return <header className="py-8">
  <div className="container.mx-auto">
  <div>
  <a href="http://" >
  <img src={Logo} alt="" />
  </a>
  </div>
  </div>
  </header>;
};

export default Header;
